import Link from 'next/link';

const Navbar = () =>  (

    <div>

        <nav class="navbar navbar-default">
        <div class="container-fluid">
            <ul class="nav navbar-nav"> 
                <li><a href="#">Page 1</a></li>
                <li><a href="#">Page 2</a></li>
                <li><a href="#">Page 3</a></li>
            </ul>
        </div>
        </nav>

    </div>

);


export default Navbar;
